rome.job:
query VECRomeJob($queryVector: [Float]) {
  rome(queryVector: $queryVector) {
    employment {
      Position {
        id
        type
        prefLabel {
          value
        }
      }
    }
  }
}

rome.skill:
query VECRomeSkill($queryVector: [Float]) {
  rome {
    skills(queryVector: $queryVector) {
      Skill_rome {
        id
        type
        prefLabel {
          value
        }
        _met {
          score
        }
      }
    }
  }
}

